tables.table_schema:
CREATE TABLE gene_expression_analysis (
    gene_id INT PRIMARY KEY,
    gene_name VARCHAR,
    expression_level FLOAT
);

CREATE TABLE gene_expression_analysis (
    gene_id UUID PRIMARY KEY,
    gene_name TEXT,
    expression_level FLOAT,
    significance_level FLOAT
);

CREATE TABLE differential_expression (
    de_id UUID PRIMARY KEY,
    gene_id UUID,
    condition TEXT,
    fold_change FLOAT
);

CREATE TABLE genes (
    gene_id UUID PRIMARY KEY,
    gene_name STRING,
    expression_level FLOAT
);

CREATE TABLE samples (
    sample_id UUID PRIMARY KEY,
    sample_name STRING,
    study_id UUID
);

CREATE TABLE GeneExpressionData (
    gene_id INT PRIMARY KEY,
    gene_name VARCHAR(255),
    expression_level FLOAT
);

CREATE TABLE SampleData (
    sample_id INT PRIMARY KEY,
    sample_name VARCHAR(255),
    tissue_type VARCHAR(255),
    date_collected DATE
);

CREATE TABLE ExperimentData (
    experiment_id INT PRIMARY KEY,
    experiment_name VARCHAR(255),
    research_type VARCHAR(255),
    start_date DATE
);
